import React from 'react';

const OverlayLeft = () => {
    return (
        <div className='overlay-panel overlay-left'>
            <h1>Welcome Back!</h1>
            <p>
                stay connected with us
            </p>
            <button class="ghost" id="signIn">Sign In</button>
        </div>
    );
}

export default OverlayLeft;
